import React from "react";
import Slot from './Slotm';

const Notmatching = props => {
    
  return (
    <>
      <div>
        <h1>
          {props.x}
          {props.y}
          {props.z}
        </h1>
        <h1>this is Not Matching</h1>
        <hr />
      </div>
    </>
  );
};
export default Notmatching;
